import React from 'react';
import { Link } from 'react-router-dom';
function Row({div}) {
        return (<div className="row-containers"><div class="column">
                <img  alt={div.name} src={div.image} /></div><p>
                        <Link className="a2" to={"/product/" + div.name.split(' ').join('+')}>{div.name}</Link> 
                        <s style={{display:'block'}}>Orginial Price: ${Math.floor(div.price + (div.price*0.2))}.99</s>
                        </p>
                        <span style={{textDecoration:'underline',color:'red'}}><b>${div.price}</b>
                        </span></div>)
   
}

export default Row;
